const App = () => {
  return (
    <Provider store={store}>
      {/* <PersistGate persistor={persistor}> */}
      <div data-testid="app">
        <Router>
          <Navbar />
          <Search />

          <Routes />

          <Footer />
        </Router>
      </div>
      {/* </PersistGate> */}
    </Provider>
  );
};

export default App;
